 We can use React Context to create a global state for the Tooltip component.

## Create a Tooltip in NextJS using React Context

### Step 1: Create a Tooltip Context

Create a new file called TooltipContext.js and add the following code:
```
import { createContext } from "react";

const TooltipContext = createContext();

export default TooltipContext;
```
### Step 2: Create a TooltipProvider

Create a new file called TooltipProvider.js and add the following code:
```
import { useState } from "react";
import TooltipContext from "./TooltipContext";

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  return (
    <TooltipContext.Provider value={{ tooltip, setTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export default TooltipProvider;
```
### Step 3: Create a Tooltip component

Create a new file called Tooltip.js and add the following code:
```
import { useContext } from "react";
import TooltipContext from "./TooltipContext";

const Tooltip = ({ children, tooltipText }) => {
  const { tooltip, setTooltip } = useContext(TooltipContext);

  return (
    <div>
      {children}
      {tooltip && (
        <div className="tooltip">
          <p>{tooltipText}</p>
          <button onClick={() => setTooltip(null)}>Close</button>
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```
### Step 4: Use the Tooltip component

Now we can use the Tooltip component in our application. For example, we can create a button that displays a tooltip when clicked:
```
import TooltipProvider from "./TooltipProvider";
import Tooltip from "./Tooltip";

const App = () => {
  return (
    <TooltipProvider>
      <Tooltip tooltipText="This is a tooltip">
        <button>Click me</button>
      </Tooltip>
    </TooltipProvider>
  );
};

export default App;
```
### Step 5: Style the Tooltip component

Finally, we can style the Tooltip component using CSS. For example:
```
.tooltip {
  position: absolute;
  top: 0;
  left: 0;
  background-color: #333;
  color: #fff;
  padding: 10px;
  border-radius: 5px;
  opacity: 0;
  transition: opacity 0.3s;
}

.tooltip:hover {
  opacity: 1;
}

.tooltip p {
  margin: 0;
}

.tooltip button {
  margin: 0;
  padding: 5px 10px;
  border: none;
  background-color: #333;
  color: #fff;
  cursor: pointer;
}
```
### Conclusion

In this article, we learned how to create a Tooltip component in NextJS using React Context. We created a TooltipContext and a TooltipProvider component, and then used the Tooltip component in our application. Finally, we styled the Tooltip component using CSS.

