## Answer

You can use the sort() method of the table element. It will sort the table by the column header that you click on. You can also pass a parameter to the sort() method to specify the sort order (ascending or descending).

Here is an example:
```
$(document).ready(function() {
  $('#table').DataTable();
  $('#table').on('click', 'th', function() {
    $(this).parent().find('th').removeClass('sort');
    $(this).addClass('sort');
    $('#table').find('tbody').sortElements(function(a, b) {
      var keyA = $(a).find('.sort').text();
      var keyB = $(b).find('.sort').text();
      if (keyA == keyB) return 0;
      if (keyA < keyB) return -1;
      else return 1;
    });
  });
});
