Static optimization techniques are applied during the compilation phase and do not require any runtime information. These techniques include loop unrolling, function inlining, and constant propagation. Loop unrolling involves unrolling the loop by a factor of n, where n is the number of iterations in the loop. This reduces the number of instructions executed and improves the cache performance. Function inlining involves replacing a function call with the body of the function. This reduces the number of function calls and improves the performance. Constant propagation involves replacing a variable with its constant value if the value is known at compile time. This reduces the number of memory accesses and improves the performance.
